(function() {
  var submit_task;

  App.list = App.cable.subscriptions.create("ListChannel", {
    connected: function() {},
    disconnected: function() {},
    received: function(data) {
      var $list, $task, $user;
      $list = $('[data-list-id = "' + data.list_id + '"]');
      $user = $('[data-user-id = "' + data.user + '"]', $list);
      $task = $('[data-task-id = "' + data.id + '"]', $user);
      if ($task.length > 0) {
        switch (data.status) {
          case 'saved':
            $task.replaceWith(data.html);
            return $('.edit_task').submitOnCheck();
          case 'deleted':
            return $task.remove();
          case 'completed':
            $task.remove();
            $('#complete_tasks', $user).prepend(data['html']);
            return $('.edit_task').submitOnCheck();
        }
      } else {
        $('#incomplete_tasks', $user).prepend(data['html']);
        $('.edit_task').submitOnCheck();
        return $('#list_user_' + data['user'] + ' .new_task #detail').val('');
      }
    }
  }, submit_task = function() {}, $('#new_task #detail').on('keydown', function(event) {
    if (event.keyCode === 13) {
      $('#new_task #create_task_button').click();
      event.target.value = "";
      return event.preventDefault();
    }
  }));

}).call(this);
